import React, {useState} from 'react';
import axios from 'axios';
import TextField from '@material-ui/core/TextField';
const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: '25ch',
    },
  },
}));

function Login() {
  const classes = useStyles();
  const [body, setBody] = useState({
    username: "",
    password: ""
  });
  function changeBodyInfo(e) {
     setBody({...body, [e.target.className]:e.target.value})
     console.log(body)
  }
  function loginSubmit() {
    console.log(body)
    axios.post('http://localhost:8080/users/authenticate', body, {headers: {'Content-Type': 'application/json'}})
    .then(function (response) {
      console.log(response);
    })
    .catch(function (error) {
      console.log(error);
    });
  }
  return(
    <div className="Login">
      <input type="text" className = "username" value={body.username} onChange = {changeBodyInfo}/>
      <input type="password" className = "password" value={body.password} onChange = {changeBodyInfo}/>
       <button className="submit" onClick = {loginSubmit}><strong>Log In</strong></button>
      <form className={classes.root} noValidate autoComplete="off">
     <TextField id="standard-basic" label="Standard" />
     <TextField id="filled-basic" label="Filled" variant="filled" />
     <TextField id="outlined-basic" label="Outlined" variant="outlined" />
   </form>
    </div>
  )
}

export default Login;
